export default function MenuPage() {
  const [activeCategory, setActiveCategory] = useState('Starters');
  const { cart, addToCart, increaseQty, decreaseQty } = useCart();

  const isInCart = (name: string) => cart.some((i) => i.name === name);
  const getQuantity = (name: string) => {
    const item = cart.find((i) => i.name === name);
    return item ? item.quantity : 0;
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <Navbar />

      {/* Header Section */}
      <div className="bg-[#FF7A00] text-white py-20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <Link
            href="/"
            className="inline-flex items-center text-white hover:text-gray-200 transition-colors mb-6"
          >
            <ArrowLeft className="w-5 h-5 mr-2" />
            Back to Home
          </Link>
          <h1 className="text-5xl md:text-6xl font-bold mb-4">Full Menu</h1>
          <p className="text-xl text-white/90">
            Explore our complete selection of delicious dishes
          </p>
        </div>
      </div>

      {/* Category Tabs */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div className="flex flex-wrap justify-center gap-4 mb-12 sticky top-0 bg-gray-50 py-4 z-40">
          {Object.keys(fullMenu).map((category) => (
            <button
              key={category}
              onClick={() => setActiveCategory(category)}
              className={`px-6 py-3 rounded-full font-medium transition-all ${
                activeCategory === category
                  ? 'bg-[#FF7A00] text-white shadow-lg scale-105'
                  : 'bg-white text-gray-700 hover:bg-gray-100 shadow'
              }`}
            >
              {category}
            </button>
          ))}
        </div>

        {/* Menu Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {(fullMenu[activeCategory as keyof typeof fullMenu] || []).map((item, index) => (
            <div key={index} className="bg-white shadow-lg rounded-lg overflow-hidden">
              <img src={item.image} alt={item.name} className="w-full h-56 object-cover" />
              <div className="p-6">
                <h3 className="text-xl font-bold">{item.name}</h3>
                <p className="text-gray-600">{item.description}</p>
                <p className="text-lg font-bold mt-2">{item.price}</p>

                {isInCart(item.name) ? (
                  <>
                    <Link
                      href="/checkout"
                      className="bg-green-600 hover:bg-green-700 text-white text-lg px-4 py-2 mt-4 block rounded-full text-center"
                    >
                      Go to Cart
                    </Link>

                    {/* Quantity Controls */}
                    <div className="flex items-center justify-center mt-2 space-x-4">
                      <button
                        onClick={() => decreaseQty(item.name)}
                        className="bg-gray-200 px-3 py-1 rounded-full text-lg"
                      >
                        -
                      </button>
                      <span>{getQuantity(item.name)}</span>
                      <button
                        onClick={() => increaseQty(item.name)}
                        className="bg-gray-200 px-3 py-1 rounded-full text-lg"
                      >
                        +
                      </button>
                    </div>
                  </>
                ) : (
                  <button
                    onClick={() => addToCart(item)}
                    className="bg-[#FF7A00] hover:bg-[#e66d00] text-white text-lg px-4 py-2 mt-4 w-full rounded-full"
                  >
                    Add to Cart
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
      <Footer />
    </div>
  );
}